import React from 'react'
function Navbar() {
  return (
    <nav className='nav'>
   <link to="/"  className='link-home'>Home</link>
   <link to="/"  className='link-about'>About</link>
   <link to="/"  className='link-Services'>Sevices</link>
    </nav>
  )
}

export default Navbar
